import React from "react";
import { useNavigate } from "react-router-dom";

const AuthPage = () => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h1 className="text-3xl font-bold mb-6">Study Tracker</h1>
      
      {/* Images of Happy Students */}
      <div className="flex space-x-4 mb-6">
        <img src="/images/student1.jpg" alt="Student 1" className="w-32 h-32 rounded-full"/>
        <img src="/images/student2.jpg" alt="Student 2" className="w-32 h-32 rounded-full"/>
        <img src="/images/student3.jpg" alt="Student 3" className="w-32 h-32 rounded-full"/>
      </div>

      <div className="space-x-4">
        <button onClick={() => navigate("/register")} className="px-6 py-2 bg-green-500 text-white rounded">Register</button>
        <button onClick={() => navigate("/login")} className="px-6 py-2 bg-blue-500 text-white rounded">Login</button>
      </div>
    </div>
  );
};

export default AuthPage;
